class Solution:
    def numSub(self, s: str) -> int:
        def num1s(n):
            res = 0
            for i in range(1, n+1):
                res += n - i + 1
            return res

        n1 = 0
        res = 0
        for k, c in enumerate(s):
            if c == '1':
                n1 += 1
                if k+1 == len(s) or s[k+1] == '0':
                    res += num1s(n1)
                    n1 = 0

        return res % (10**9+7)


sol = Solution()
# s = "0110111"
# s = "101"
# s = "111111"
# s = "000"
s = ""
print(sol.numSub(s))
